 {flex: 0 0 85px !important;}\n  .mt-4 .article-meta, .article .field-lead {font-size: .7rem !important;}\n  .mt-4 .article .field-title {font-size: 0.8rem !important;}\n  #main > .container .row {margin-left: 0 !important; margin-right: 0 !important;}\n  #main > .container-fluid > .row > .col > .row.mt-4 .owl-carousel .owl-stage-outer {height: 334px !important;}\n  .block-breaking-news .article  .content.pl-2 .field-title {font-size: 0.7rem !important;}\n  //.sidebar > div[id^=\"div-gpt-ad-\"][style*=\"margin\"] {margin-left:0 !important;}\n</style>\n\n<script>\n    // ElemInit : function that gather several elements in a container.\n //\n // elemBlock -> Name of the element that will contains each elements.\n    // funcArgs -> Array of CSS selectors\n function ElemInit(elemBlock, funcArgs) {\n  // funcArgs[0] -> CSS selector of the parent of each elements.\n  // funcArgs[1] -> CSS selector of the first element.\n\n  var sublimeBody = sublime.window.document.body;\n  var sublimeContainer = sublime.window.document.querySelector(funcArgs[0]);\n  var sublimePartOne = sublime.window.document.querySelector(funcArgs[1]);\n  var sublimeTestElem = [];\n  //Create the container \n        var sublimeBlock = sublime.window.document.createElement(\'div\');\n        sublimeBlock.id = elemBlock;\n        sublimeBody.appendChild(sublimeBlock);\n  \n  //sublimeTestElem : Allow to check if the container and the elements exist\n        sublimeTestElem.push((sublimeContainer !== null && typeof sublimeContainer !== \"undefined\"));\n        sublimeTestElem.push((sublimePartOne !== null && typeof sublimePartOne !== \"undefined\"));\n\n        console.groupCollapsed(\'%c ElemInit function log \', \'color:blue; background-color:lightblue;\');\n  if (sublimeTestElem[0] && sublimeTestElem[1]) { // check if the container  and the first part exist\n   sublimeContainer.insertBefore(sublimeBlock, sublimePartOne);\n   console.log(\"The element \"+ elemBlock + \" have been moved in \"+ funcArgs[0] + \" before \" + funcArgs[1]);\n     }\n     else {\n      // check if the container doesn\'t exists\n      if (sublimeTestElem[0] === false) {\n    console.error(\"The element \"+ elemBlock + \" couldn\'t be moved because \"+ funcArgs[0] +\" doesn\'t exist\");\n      }\n      // check if every part of the header/footer/group doesn\'t exists until one part exists\n      if (sublimeTestElem[1] === false) {\n    console.error(\"The element \"+ elemBlock + \" couldn\'t be moved because \"+ funcArgs[1] +\" doesn\'t exist\");\n    var n = 1;\n    // check if every part of the header/footer/group doesn\'t exists until one part exists OR there are no part left in the array\n                while (sublimeTestElem[1] === false && n < funcArgs.length) {\n                    n++;\n                    sublimePartOne = sublime.window.document.querySelector(funcArgs[n]);\n                    sublimeTestElem[1] = (sublimePartOne !== null && typeof sublimePartOne !== \"undefined\");\n                    // check if the part exists\n                    if (sublimeTestElem[1] === true) {\n                        sublimeContainer.insertBefore(sublimeBlock, sublimePartOne);\n                    }\n                }\n      }\n     }\n     //Move each elements to the container (elemBlock)\n  for (var j=1; j < funcArgs.length; j++) {\n   var sublimePart = sublime.window.document.querySelector(funcArgs[j]);\n   if (sublimePart !== null && typeof sublimePart !== \"undefined\"){\n    sublimeBlock.appendChild(sublimePart);\n    console.log(\"The element \"+ funcArgs[j] + \" have been moved in \"+ elemBlock);\n   }\n   else {\n    console.error(\"The element \"+ funcArgs[j] + \" couldn\'t be moved because it doesn\'t exist\");\n   }\n  }\n\n\n  console.groupEnd();\n }\n\n function checkDivPresenceContainer(div, containerName, callback, args){\n        myDiv = sublime.window.document.querySelector(div);\n        var i = 0;\n        if (myDiv) {\n            callback(containerName, args);\n        } else {\n            top.sublime.timer.setTimeout(function(){\n                if (i > 30) {\n                    top.sublime.timer.clearTimeout(function() {\n                        checkDivPresenceContainer();\n                    });\n                } else {\n                checkDivPresenceContainer(div, containerName, callback, args);\n                }\n                i += 1;\n            }, 100);\n        }\n    }\n    /******** Change the \"elemContainer\" value with the CSS selector of the parent of the elements ********/\n     var elemContainer = \"#app\"; \n     var elemPartsTab = [elemContainer, \"#header\", \".navbar\", \".content-top .category-nav\"];\n    /******** Change the \"sublimeContainer\" value with name you want for the container of the elements ********/\n checkDivPresenceContainer(\'#ayads-html\', \'sublimeHeader\', ElemInit, elemPartsTab);\n</script>\n\n<script>\nfunction init(){\n    /* Init variables */\n    var html = sublime.window.document.querySelector(\'html\'),\n        body = sublime.window.document.body,\n        isSafari = navigator.userAgent.indexOf(\'Safari\') != -1 && navigator.userAgent.indexOf(\'Chrome\') == -1,\n        isMac = navigator.appVersion.indexOf(\"Mac\") != -1,\n        isVideo = !sublime.isEmpty(sublime.creativeAd.videos),\n        bgfix = sublime.creativeAd.fixed,\n        format = \'\',\n        ayadsVideoLayer,\n        firstCall,\n        i = 0,\n        /* Edit variables */\n        maxHeightHeader = 162,\n        minHeightHeader = 0;\n    /**************** ADAPT MARGIN TO HTML AND LAUNCH FUNCTION FOR OTHERS ELEMENTS ****************/\n    function fixSkin(){\n        html.style.cssText = \'margin-top:\' + maxHeightHeader + \'px !important;\';\n        if ((bgfix && !isVideo) || (!bgfix && isMac && isSafari)) {\n            body.style.cssText = \'background-position: center \'+maxHeightHeader+\'px !important;\';\n        }\n        if (bgfix) {\n            fixSkinOnScrollEvent();\n            if 