{\n            newMarginTop = minHeightHeader;\n        }\n \n        if (isVideo && ayadsVideoLayer) {\n            ayadsVideoLayer.style.cssText = \'top:\' + newMarginTop + \'px !important;\';\n        } else {\n            body.style.cssText = \'background-position:center \' + newMarginTop + \'px !important;\';\n        }\n    }\n    /**************** CHECK IF ELEMENT IS PRESENT ****************/\n    function checkDivPresence(div, callback, bool){\n        myDiv = sublime.window.document.querySelector(div);\n        if (myDiv) {\n            if (bool) {\n                if (isVideo && div === \"#ayads-video-layer\") {\n                    ayadsVideoLayer = myDiv;\n                }\n                firstCall = true;\n            }\n            callback(myDiv);\n        } else {\n            top.sublime.timer.setTimeout(function(){\n                if (i > 30) {\n                    top.sublime.timer.clearTimeout(function() {\n                        checkDivPresence();\n                    });\n                } else {\n                checkDivPresence(div, callback, bool);\n                }\n                i += 1;\n            }, 100);\n        }\n    }\n    /**************** ADAPT MARGIN TO HEADER WITH A DYNAMIC HEIGHT (OPTION) ****************/\n    function getHeightDynamicHeader(headerDyn){\n        maxHeightHeader = headerDyn.offsetHeight;\n        fixSkin();\n    }\n    /**************** LAUNCH FUNCTION CHECK ****************/\n    html.style.cssText = \'margin-top:\' + maxHeightHeader + \'px !important;\';\n    if (isVideo){\n        checkDivPresence(\'#ayads-video-layer\', fixSkin, true);\n    } else {\n        checkDivPresence(\'body\', fixSkin, true);\n    };\n    sublime.hook.register(\"event.cleanUp\", function(){\n        sublime.window.removeEventListener(\'scroll\', fixSkinOnScrollEvent);\n        html.style.marginTop = \'\';\n    });\n    checkDivPresence(\'#sublimeHeader\', getHeightDynamicHeader);\n}\n/**************** LAUNCH GLOBAL FUNCTION